et</h4>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">Hot and cold</h6>\n</div>\n</div>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">Paparazzie</h6>\n</div>\n</div>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">Awitin mo isasayaw ko</h6>\n</div>\n</div>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">Manila Girl</h6>\n</div>\n</div>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">Last Friday Night</h6>\n</div>\n</div>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">I love the night life</h6>\n</div>\n</div>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">Rockabye</h6>\n</div>\n</div>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">Price tag</h6>\n</div>\n</div>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">Superstar</h6>\n</div>\n</div>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">Girl in the mirror</h6>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div>&nbsp;</div>\n</td>\n<td style=\"width: 449.5px;\">&nbsp;\n<div>\n<h4 class=\"text-primary fw-bolder cursor-pointer mb-0\">First Set</h4>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<div class=\"m-0\">\n<div class=\"d-flex align-items-ce