(6, 'The Man Who Cant Be Moved', 5, '<pre class=\"_3F2CP _3hukP\"><span class=\"_3rlxz\">[Intro]\r\n</span><span class=\"_3rlxz\"><span class=\"_3PpPJ OrSDI\" data-name=\"G\">G</span>  <span class=\"_3PpPJ OrSDI\" data-name=\"D/F#\">D/F#</span>  <span class=\"_3PpPJ OrSDI\" data-name=\"C\">C</span>\r\n</span> \r\n<span class=\"_3rlxz\">[Verse]\r\n</span><span class=\"_2jIGi\"><span class=\"_3rlxz\">       <span class=\"_3PpPJ OrSDI\" data-name=\"G\">G</span>                       <span class=\"_3PpPJ OrSDI\" data-name=\"D/F#\">D/F#</span>\r\n</span><span class=\"_3rlxz\">Going back to the corner where I first saw you,\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\">     <span class=\"_3PpPJ OrSDI\" data-name=\"Am\">Am</span>                               <span class=\"_3PpPJ OrSDI\" data-name=\"C\">C</span>\r\n</span><span class=\"_3rlxz\">Gonna camp in my sleeping bag, no I\'m not gonna move,\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\">      <span class=\"_3PpPJ OrSDI\" data-name=\"G\">G</span>                       <span class=\"_3PpPJ OrSDI\" data-name=\"D/F#\">D/F#</span>\r\n</span><span class=\"_3rlxz\">Got some words on cardboard got your picture in my hand,\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\">     <span class=\"_3PpPJ OrSDI\" data-name=\"Am\">Am</span>                               <span class=\"_3PpPJ OrSDI\" data-name=\"C\">C</span>\r\n</span><span class=\"_3rlxz\">Saying if you see this girl can you tell her where I am,\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\">           <span class=\"_3PpPJ OrSDI\" data-name=\"G\">G</span>                       <span class=\"_3PpPJ OrSDI\" data-name=\"D/F#\">D/F#</span>\r\n</span><span class=\"_3rlxz\">Some try to hand me money they don\'t understand,\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\">            <span class=\"_3PpPJ OrSDI\" data-name=\"Am\">Am</span>                               <span class=\"_3PpPJ OrSDI\" data-name=\"C\">C</span>\r\n</span><span class=\"_3rlxz\">I\'m not... broke I\'m just a broken hearted man,\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\">            <span class=\"_3PpPJ OrSDI\" data-name=\"G\">G</span>                       <span class=\"_3PpPJ OrSDI\" data-name=\"D/F#\">D/F#</span>\r\n</span><span class=\"_3rlxz\">I know it makes no sense, but what else can I do,\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\">     <span class=\"_3PpPJ OrSDI\" data-name=\"Am\">Am</span>                               <span class=\"_3PpPJ OrSDI\" data-name=\"C\">C</span>\r\n</span><span class=\"_3rlxz\">How can I move on when I\'m still in love with you...\r\n</span></span> \r\n<span class=\"_3rlxz\">[Pre-Chorus]\r\n</span><span class=\"_2jIGi\"><span class=\"_3rlxz\">           <span class=\"_3PpPJ OrSDI\" data-name=\"G\">G</span>                                 <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>\r\n</span><span class=\"_3rlxz\">\'Cause if one day you wake up and find that you\'re missing me,\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\">           <span class=\"_3PpPJ OrSDI\" data-name=\"Am\">Am</span>                                   <span class=\"_3PpPJ OrSDI\" data-name=\"C\">C</span>\r\n</span><span class=\"_3rlxz\">And your heart starts to wonder where on this earth I can be,\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\">         <span class=\"_3PpPJ OrSDI\" data-name=\"G\">G</span>                                 <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>\r\n</span><span class=\"_3rlxz\">Thinking maybe you\'d come back here to the place that we\'d meet,\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\">           <span class=\"_3PpPJ OrSDI\" data-name=\"Am\">Am</span>                             <span class=\"_3PpPJ OrSDI\" data-name=\"C\">C</span>             <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>\r\n</span><span class=\"_3rlxz\">And you\'d see me waiting for you on the corner of the street.\r\n</span></span> \r\n<span class=\"_3rlxz\">[Chorus]\r\n</span><span class=\"_2jIGi\"><span class=\"_3rlxz\">        <span class=\"_3PpPJ OrSDI\" data-name=\"G\">G</span>        <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>\r\n</span><span class=\"_3rlxz\">So I\'m not moving...\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\">        <span class=\"_3PpPJ OrSDI\" data-name=\"Am\">Am</span>       <span class=\"_3PpPJ OrSDI\" data-name=\"C\">C</span>\r\n</span><span class=\"_3rlxz\">I\'m not moving.\r\n</span></span> \r\n<span class=\"_3rlxz\">[Verse]\r\n</span><span class=\"_2jIGi\"><span class=\"_3rlxz\"><span class=\"_3PpPJ OrSDI\" data-name=\"G\">G</span>                        <span class=\"_3PpPJ OrSDI\" data-name=\"D/F#\">D/F#</span>\r\n</span><span class=\"_3rlxz\">Policeman says, son you can\'t stay here,\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\">                 <span class=\"_3PpPJ OrSDI\" data-name=\"Am\">Am</span>                      <span class=\"_3PpPJ OrSDI\" data-name=\"C\">C</span>\r\n</span><span class=\"_3rlxz\">I said there\'s someone I\'m waiting for if it\'s a day, a month, a year,\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\"><span class=\"_3PpPJ OrSDI\" data-name=\"G\">G</span>                       <span class=\"_3PpPJ OrSDI\" data-name=\"D/F#\">D/F#</span>\r\n</span><span class=\"_3rlxz\">Gotta stand my ground even if it rains or snows,\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\">    <span class=\"_3PpPJ OrSDI\" data-name=\"Am\">Am</span>                               <span class=\"_3PpPJ OrSDI\" data-name=\"C\">C</span>\r\n</span><span class=\"_3rlxz\">If she changes her mind this is the first place she will go.\r\n</span></span> \r\n<span class=\"_3rlxz\">[Pre-Chorus]\r\n</span><span class=\"_2jIGi\"><span class=\"_3rlxz\">           <span class=\"_3PpPJ OrSDI\" data-name=\"G\">G</span>                   